// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "./Roles.sol";
import "./IMembershipManager.sol";

/**
 * @title ClaimManager
 * @notice Manages participant claims for the Decentralized Health Risk Protocol
 */
contract ClaimManager is Roles {
    // =========================
    // ENUMS
    // =========================

    enum ClaimStatus {
        Pending,
        Approved,
        Rejected
    }

    // =========================
    // STRUCTS
    // =========================

    struct Claim {
        address participant;
        uint256 amount;
        ClaimStatus status;
    }

    // =========================
    // STATE VARIABLES
    // =========================

    IMembershipManager public membershipManager;
    uint256 public claimCounter;
    mapping(uint256 => Claim) public claims;

    // =========================
    // EVENTS
    // =========================

    event ClaimSubmitted(uint256 indexed claimId, address indexed participant, uint256 amount);
    event ClaimApproved(uint256 indexed claimId, address indexed provider);
    event ClaimRejected(uint256 indexed claimId, address indexed provider);

    // =========================
    // CONSTRUCTOR
    // =========================

    constructor(address _membershipManager) {
        membershipManager = IMembershipManager(_membershipManager);
    }

    // =========================
    // CLAIM LOGIC
    // =========================

    function submitClaim(uint256 amount) external {
        // Pastikan pengirim adalah peserta aktif
        require(
            membershipManager.isActiveParticipant(msg.sender),
            "Only active participants can submit claims"
        );

        claimCounter += 1;
        claims[claimCounter] = Claim({
            participant: msg.sender,
            amount: amount,
            status: ClaimStatus.Pending
        });

        emit ClaimSubmitted(claimCounter, msg.sender, amount);
    }

    function approveClaim(uint256 claimId) external onlyRole(HOSPITAL_ROLE) {
        Claim storage claim = claims[claimId];

        // Pastikan claim masih pending
        require(claim.status == ClaimStatus.Pending, "Claim is not pending");

        // Pastikan provider terdaftar dan disetujui
        require(
            membershipManager.isApprovedProvider(msg.sender),
            "Only approved providers can approve claims"
        );

        claim.status = ClaimStatus.Approved;

        emit ClaimApproved(claimId, msg.sender);
    }

    function rejectClaim(uint256 claimId) external onlyRole(HOSPITAL_ROLE) {
        Claim storage claim = claims[claimId];

        // Pastikan claim masih pending
        require(claim.status == ClaimStatus.Pending, "Claim is not pending");

        // Pastikan provider terdaftar dan disetujui
        require(
            membershipManager.isApprovedProvider(msg.sender),
            "Only approved providers can reject claims"
        );

        claim.status = ClaimStatus.Rejected;

        emit ClaimRejected(claimId, msg.sender);
    }

    function getClaim(uint256 claimId) external view returns (Claim memory) {
        return claims[claimId];
    }
}

contracts/HealthRiskPool.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "./Roles.sol";

contract HealthRiskPool is Roles {
    uint256 public totalPoolBalance;

    event Deposit(address indexed user, uint256 amount);
    event ClaimPaid(address indexed to, uint256 amount);

    constructor(address admin) {
        _grantRole(DEFAULT_ADMIN_ROLE, admin);
        _grantRole(CLAIM_MANAGER_ROLE, admin);
    }

    /// @notice User deposits ETH into the risk pool
    function deposit() external payable {
        require(msg.value > 0, "Deposit must be > 0");

        totalPoolBalance += msg.value;
        emit Deposit(msg.sender, msg.value);
    }

    /// @notice Pay approved insurance claim (only Claim Manager)
    function payClaim(address payable to, uint256 amount)
        external
        onlyRole(CLAIM_MANAGER_ROLE)
    {
        require(amount <= address(this).balance, "Insufficient pool balance");

        totalPoolBalance -= amount;

        (bool success, ) = to.call{value: amount}("");
        require(success, "ETH transfer failed");

        emit ClaimPaid(to, amount);
    }

    /// @notice Current ETH balance of pool
    function poolBalance() external view returns (uint256) {
        return address(this).balance;
    }

    /// @notice Receive ETH from MembershipManager
    receive() external payable {
        totalPoolBalance += msg.value;
    }
}

